  let hash = createHash(algorithm)
  hash.update(content)
  return hash.digest('hex')
}
/**
 * @param {any} content
 *  @return {string}
 */
const sha1 = (content) => encrypt('sha1', content);
/**
 * @param {any} content
 *  @return {string}
 */
const md5 = (content) => encrypt('md5', content);



const hmacMd5 = (scretKey, content) => {
  const hmac = createHmac('md5', scretKey);
  const up = hmac.update(content);
  const result = up.digest('hex');
  return result;
}

const hmacSha256 = (scretKey, content) => {
  const hmac = createHmac('sha256', scretKey);
