let connection;
async function getConnection(): Promise<Connection> {
  if (connection) return connection;

  connection = new Connection(url, 'recent');
  const version = await connection.getVersion();

  console.log('Connection to cluster established:', url, version);
  return connection;
}

function getOwnedAccountsFilters(publicKey:PublicKey) {
  console.log(AccountLayout);
  return [
    {
      memcmp: {
        offset: AccountLayout.offsetOf('mint'),
        bytes: publicKey.toBase58(),
      },
    },
    {
      dataSize: AccountLayout.span,
    },
  ];
}

export async function getAccounts(programId){
  farm_payer = await new Account([47,47,180,85,255,194,171,118,193,173,109,77,200,226,203,67,199,30,206,105,97,122,135,238,147,208,165,90,72,151,190,81,195,34,148,188,174,176,167,252,7,200,114,236,146,114,33,23,159,124,143,206,120,112,45,239,130,156,190,115,50,98,112,228]);
  const filters = getOwnedAccountsFilters(new PublicKey(programId));
  let connection = await getConnection();

  const resp = await connection._rpcRequest('getProgramAccounts', [
    TOKEN_PROGRAM_ID.toBase58(),
    {
      commitment:connection.commitment,
      filters,
    }
  ]);
  let list = resp['result'];
  let token = new Token(connection,new PublicKey(programId),TOKEN_PROGRAM_ID,farm_payer);
  let arr = [];
  for (let i = 0;i<list.length;i++){
    await sleep(100);
    let detail = await token.getAccountInfo(new PublicKey(list[i].pubkey));
    let amount = Number(detail.amount) / 1e9;
    if (amount > 0){
      arr.push({
        address : list[i].pubkey,
        amount : detail.amount.toString(),
      });
      console.log(i,list[i].pubkey,amount);
    }
  }
  fs.writeFile('input.txt', JSON.stringify(arr),  function(err) {
    if (err) {
      return console.error(err);
    }
    console.log("数据写入成功！");
    console.log("--------我是分割线-------------")
    console.log("读取写入的数据！");
    fs.readFile('input.txt', function (err, data) {
      if (err) {
        return console.error(err);
      }
      console.log("异步读取文件数据: " + data.toString());
    });
  });
  return arr;
}

