/**
 * @flow
 */

import assert from 'assert';
import BN from 'bn.js';
import { Buffer } from 'buffer';
import * as BufferLayout from 'buffer-layout';
import type { Connection, TransactionSignature } from '@solana/web3.js';
import {
  Account,
  PublicKey,
  SystemProgram,
  Transaction,
  TransactionInstruction,
} from '@solana/web3.js';

import * as Layout from './layout';
import { sendAndConfirmTransaction } from './util/send-and-confirm-transaction';
import { loadAccount } from './util/account';
import { AccountLayout, Token, TOKEN_PROGRAM_ID } from '@solana/spl-token';
export const TOKEN_SWAP_PROGRAM_ID: PublicKey = new PublicKey(
  // 'HTpjeN1FocdopyJxwFJzBsQ5edeDVXkNB3ssePWmhfyj',
  'DgUj4FuTYjFVTK6yT73MuGNS3wV3FPXa4Kp3Mqw87a77',
  // '51MP7fEUh9aexfZsRkHwQdSa7zFxVdPjYW9aRMUZ7Ygb'
  // 'C9THsxkiKNj3TFNSPDsSzCBGmB3Zvjn1vaAUDH6YvYhv',
);
//

/**
 * Some amount of tokens
 */
export class Numberu64 extends BN {
  /**
   * Convert to Buffer representation
   */
  toBuffer(): typeof Buffer {
    const a = super.toArray().reverse();
    const b = Buffer.from(a);
    if (b.length === 8) {
      return b;
    }
    assert(b.length < 8, 'Numberu64 too large');

    const zeroPad = Buffer.alloc(8);
    b.copy(zeroPad);
    return zeroPad;
  }

  /**
   * Construct a Numberu64 from Buffer representation
   */
  static fromBuffer(buffer: typeof Buffer): Numberu64 {
    assert(buffer.length === 8, `Invalid buffer length: ${buffer.length}`);
    return new Numberu64(
      [...buffer]
        .reverse()
        .map(i => `00${i.toString(16)}`.slice(-2))
        .join(''),
      16,
    );
  }
}

/**
 * Some amount of tokens
 */
export class Numberu128 extends BN {
  /**
   * Convert to Buffer representation
   */
  toBuffer(): typeof Buffer {
    const a = super.toArray().reverse();
    const b = Buffer.from(a);
    if (b.length === 16) {
      return b;
    }
    assert(b.length < 16, 'Numberu64 too large');

    const zeroPad = Buffer.alloc(16);
    b.copy(zeroPad);
    return zeroPad;
  }

  /**
   * Construct a Numberu64 from Buffer representation
   */
  static fromBuffer(buffer: typeof Buffer): Numberu64 {
    assert(buffer.length === 16, `Invalid buffer length: ${buffer.length}`);
    return new Numberu64(
      [...buffer]
        .reverse()
        .map(i => `00${i.toString(16)}`.slice(-2))
        .join(''),
      16,
    );
  }
}

/**
 * // farm 结构体
 * @private
 */
export const TokenFarmLayout: typeof BufferLayout.Structure = BufferLayout.struct(
  [
    BufferLayout.u8('isInitialized'), // 1-2
    BufferLayout.u8('nonce'), // 1
    Layout.publicKey('tokenProgramId'),
    Layout.publicKey('poolFarmAddress'), // 矿池 farm地址
    Layout.publicKey('poolLpAddress'), // 矿池 lp地址
    Layout.publicKey('poolFeeLpAddress'), // 矿池 lp手续费地址
    Layout.uint64('tradeFeeNumerator'),
    Layout.uint64('tradeFeeDenominator'),
    Layout.uint64('ownerTradeFeeNumerator'),
    Layout.uint64('ownerTradeFeeDenominator'),
    Layout.uint64('ownerWithdrawFeeNumerator'),
    Layout.uint64('ownerWithdrawFeeDenominator'),
    Layout.uint64('hostFeeNumerator'),
    Layout.uint64('hostFeeDenominator'),
    Layout.uint64('lastUpdate'), // 最后一次slot
    Layout.uint64('rewardPerSecond'), // 每slot奖励
    Layout.uint128('rewardPerShare'),// 每个份额奖励
    Layout.uint64('totalSupply'), // 总质押量
    Layout.uint128('rayPerShare'), // ray 每份额奖励
    Layout.uint64('rayTotalSupply'), // 总质押量
    Layout.uint128('otherPerShare'), // other 每份额奖励
    Layout.uint64('otherTotalSupply'), // 总质押量
    Layout.publicKey('owner'), // owner
    Layout.publicKey('poolRayAddress'), // owner
    Layout.publicKey('poolId'), // owner
    Layout.publicKey('poolUserInfo'), // owner
    Layout.publicKey('poolOtherAddress'), // owner
  ],
);

/**
 * // farm user 结构体
 * @private
 */
export const TokenFarmUserLayout: typeof BufferLayout.Structure = BufferLayout.struct(
  [
      BufferLayout.u8('isInitialized'), // 1-2
      Layout.publicKey('poolId'), //
      Layout.uint64('amount'), // 质押金额
      Layout.uint64('rewardDebt'),// 理论已领取奖励
      Layout.uint64('rayDebt'),// 理论ray已领取奖励
      Layout.uint64('otherDebt'),// 理论ray已领取奖励
      Layout.publicKey('userLpAddress'),// 理论ray已领取奖励
  ],
);

/**
 * // farm user 结构体
 * @private
 */
export const TokenRayUserLayout: typeof BufferLayout.Structure = BufferLayout.struct(
  [
    Layout.uint64('state'), // 8 + 32 + 32 + 8 + 8
    Layout.publicKey('poolId'),
    Layout.publicKey('stakerOwner'),
    Layout.uint64('depositBalance'),
    Layout.uint64('rewardDebt')
  ],
);

/**
 * // farm user 结构体
 * @private
 */
export const TokenRayUserV4Layout: typeof BufferLayout.Structure = BufferLayout.struct(
  [
    Layout.uint64('state'),
    Layout.publicKey('poolId'),
    Layout.publicKey('stakerOwner'),
    Layout.uint64('depositBalance'),
    Layout.uint64('rewardDebt'),
    Layout.uint64('rewardDebtB')
  ],
);

export const CurveType = Object.freeze({
  ConstantProduct: 0, // Constant product curve, Uniswap-style
  ConstantPrice: 1, // Constant price curve, always X amount of A token for 1 B token, where X is defined at init
  Offset: 3, // Offset curve, like Uniswap, but with an additional offset on the token B side
});

/**
 * A program to exchange tokens against a pool of liquidity
 */
export class TokenSwap {
  /**
   * @private
   */
  connection: Connection;

  /**
   * Program Identifier for the Token program
   */
  tokenProgramId: PublicKey;

  /**
   * The public key for the fee account receiving trade and/or withdrawal fees
   */
  feeAccount: PublicKey;

  /**
   * Authority
   */
  authority: PublicKey;

  /**
   * Fee payer
   */
  payer: Account;

  /**
   * Create a Token object attached to the specific token
   *
   * @param connection The connection to use
   * @param tokenSwap The token swap account
   * @param swapProgramId The program ID of the token-swap program
   * @param tokenProgramId The program ID of the token program
   * @param poolToken The pool token
   * @param authority The authority over the swap and accounts
   * @param tokenAccountA: The token swap's Token A account
   * @param tokenAccountB: The token swap's Token B account
   * @param payer Pays for the transaction
   */
  constructor(
    connection: Connection,
    payer: Account,
  ) {
  }

  /**
   * Get the minimum balance for the token swap account to be rent exempt
   *
   * @return Number of lamports required
   */
  static async getMinBalanceRentForExemptTokenSwap(
    connection: Connection,
  ): Promise<number> {
    return await connection.getMinimumBalanceForRentExemption(
      TokenFarmLayout.span,
    );
  }

  static createInitFarmInstruction(
    tokenProgramId: PublicKey, // 通用token 转账 的地址
    farm_info: Account, //
    authority: PublicKey, //
    pool_farm_address: PublicKey, //
    pool_lp_address: PublicKey, //
    pool_fee_lp_address: PublicKey, //
    pool_ray_address: PublicKey, //
    pool_id: PublicKey, //
    pool_user_info: PublicKey, //
    pool_other_address:PublicKey,//
    swapProgramId: PublicKey, // swap-farm 程序地址
    nonce: number,
    tradeFeeNumerator: number,
    tradeFeeDenominator: number,
    ownerTradeFeeNumerator: number,
    ownerTradeFeeDenominator: number,
    ownerWithdrawFeeNumerator: number,
    ownerWithdrawFeeDenominator: number,
    hostFeeNumerator: number,
    hostFeeDenominator: number,
    reward_per_second: number,
  ): TransactionInstruction {
    // 时间合约地址 记录区块的时间信息 slot
    let clock = new PublicKey('SysvarC1ock11111111111111111111111111111111');
    const keys = [
      { pubkey: tokenProgramId, isSigner: false, isWritable: false },// 通用token地址
      { pubkey: farm_info.publicKey, isSigner: false, isWritable: true }, // farm 矿池地址
      { pubkey: authority, isSigner: false, isWritable: false }, // 矿池auth
      { pubkey: pool_farm_address, isSigner: false, isWritable: false },// 矿池对应的farm接收地址
      { pubkey: pool_lp_address, isSigner: false, isWritable: false },// 矿池对应的lp接收地址
      { pubkey: pool_fee_lp_address, isSigner: false, isWritable: false },// 手续费地址
      { pubkey: clock, isSigner: false, isWritable: false },
      { pubkey: pool_ray_address, isSigner: false, isWritable: false },
      { pubkey: pool_id, isSigner: false, isWritable: false },
      { pubkey: pool_user_info, isSigner: false, isWritable: false },
      { pubkey: pool_other_address, isSigner: false, isWritable: false },
    ];
    const commandDataLayout = BufferLayout.struct([
      BufferLayout.u8('instruction'),
      BufferLayout.u8('nonce'),
      BufferLayout.nu64('tradeFeeNumerator'),
      BufferLayout.nu64('tradeFeeDenominator'),
      BufferLayout.nu64('ownerTradeFeeNumerator'),
      BufferLayout.nu64('ownerTradeFeeDenominator'),
      BufferLayout.nu64('ownerWithdrawFeeNumerator'),
      BufferLayout.nu64('ownerWithdrawFeeDenominator'),
      BufferLayout.nu64('hostFeeNumerator'),
      BufferLayout.nu64('hostFeeDenominator'),
      BufferLayout.nu64('reward_per_second'),
    ]);
    let data = Buffer.alloc(1024);
    {
      const encodeLength = commandDataLayout.encode(
        {
          instruction: 0, // InitializeFarm instruction
          nonce,
