  /**
   * Create a new Token Swap
   *
   * @param connection The connection to use
   * @param payer Pays for the transaction
   * @param tokenSwapAccount The token swap account
   * @param authority The authority over the swap and accounts
   * @param nonce The nonce used to generate the authority
   * @param tokenAccountA: The token swap's Token A account
   * @param tokenAccountB: The token swap's Token B account
   * @param poolToken The pool token
   * @param tokenAccountPool The token swap's pool token account
   * @param tokenProgramId The program ID of the token program
   * @param swapProgramId The program ID of the token-swap program
   * @param feeNumerator Numerator of the fee ratio
   * @param feeDenominator Denominator of the fee ratio
   * @return Token object for the newly minted token, Public key of the account holding the total supply of new tokens
   */
  static async createTokenFarm(
      raydium_stake_program_id: PublicKey,
      connection: Connection,
      payer: Account,
      tokenProgramId: PublicKey,
      farm_info: Account,
      authority: PublicKey,
      pool_farm_address: PublicKey,
      pool_lp_address: PublicKey, //
      pool_fee_lp_address: PublicKey, //
      pool_ray_address: PublicKey, //
      pool_id: PublicKey, //
      pool_user_info: PublicKey, //
      pool_other_address: PublicKey, //
      swapProgramId: PublicKey,
      nonce: number,
      tradeFeeNumerator: number,
      tradeFeeDenominator: number,
      ownerTradeFeeNumerator: number,
      ownerTradeFeeDenominator: number,
      ownerWithdrawFeeNumerator: number,
      ownerWithdrawFeeDenominator: number,
      hostFeeNumerator: number,
      hostFeeDenominator: number,
      reward_per_second: number,
      user_len: number,
  ) {
    let transaction;
    // Allocate memory for the account
    const balanceNeeded = await TokenSwap.getMinBalanceRentForExemptTokenSwap(
      connection,
    );
    transaction = new Transaction();
    transaction.add(
      SystemProgram.createAccount({
        fromPubkey: payer.publicKey,
        newAccountPubkey: farm_info.publicKey,
        lamports: balanceNeeded,
        space: TokenFarmLayout.span,
        programId: swapProgramId,
      }),
    );
    let signers = [];
    if(!pool_id){
        let pool = new Account();
        pool_id = pool.publicKey;
        signers.push(pool);
        transaction.add(
            SystemProgram.createAccount({
                fromPubkey: payer.publicKey,
                newAccountPubkey: pool_id,
                lamports: balanceNeeded,
                space: TokenFarmLayout.span,
                programId: swapProgramId,
            }),
        );
    }
    if(!pool_other_address){
        let poa = new Account();
        pool_other_address = poa.publicKey;
        signers.push(poa);
        transaction.add(
            SystemProgram.createAccount({
                fromPubkey: payer.publicKey,
                newAccountPubkey: pool_other_address,
                lamports: balanceNeeded,
                space: AccountLayout.span,
                programId: swapProgramId,
            }),
        );
    }
    if(!pool_user_info){
        let pui = new Account();
        pool_user_info = pui.publicKey;
        signers.push(pui);
        transaction.add(
            SystemProgram.createAccount({
                fromPubkey: payer.publicKey,
                newAccountPubkey: pool_user_info,
                lamports: balanceNeeded,
                space: user_len,
                programId: raydium_stake_program_id,
            }),
        );
    }
    const instruction = TokenSwap.createInitFarmInstruction(
        tokenProgramId, // 通用token 转账 的地址
        farm_info, //
        authority, //
        pool_farm_address,
        pool_lp_address, //
        pool_fee_lp_address, //
        pool_ray_address, //
        pool_id, //
        pool_user_info, //
        pool_other_address,
        swapProgramId,
        nonce,
        tradeFeeNumerator,
        tradeFeeDenominator,
        ownerTradeFeeNumerator,
        ownerTradeFeeDenominator,
        ownerWithdrawFeeNumerator,
        ownerWithdrawFeeDenominator,
        hostFeeNumerator,
        hostFeeDenominator,
        reward_per_second,
    );

    transaction.add(instruction);
    let result = await sendAndConfirmTransaction(
        'createAccount and InitializeFarm',
        connection,
        transaction,
        payer,
        farm_info,
        ...signers
    );
    console.log("result:", result)
  }
