function createUniqueAssociatedAccount(user, farm_info) {
  let user_info_account_seed = hmacSha256(user.toBase58(), farm_info.toBase58());
  let b = Buffer.from(user_info_account_seed);

  let keyPair = _tweetnacl.default.sign.keyPair.fromSeed(b.subarray(0, 32));

  return new _web.Account(keyPair.secretKey);
} // 质押与提现


