// @flow

import {
  Account,
  Connection,
  PublicKey,
} from '@solana/web3.js';
import nacl from 'tweetnacl';
import { AccountLayout, Token, TOKEN_PROGRAM_ID } from '@solana/spl-token';
import 'crypto'
import {
  TokenSwap,
  CurveType,
  TOKEN_SWAP_PROGRAM_ID, TokenRayUserLayout, TokenRayUserV4Layout, TokenFarmUserLayout,
} from '../client/token-swap';
import { sendAndConfirmTransaction } from '../client/util/send-and-confirm-transaction';
import { newAccountWithLamports } from '../client/util/new-account-with-lamports';
import { url } from '../url';
import { sleep } from '../client/util/sleep';
const { createHash, createHmac } = require('crypto');
let fs = require("fs");
/**
 * @param {string} algorithm
 * @param {any} content
 *  @return {string}
 */
const encrypt = (algorithm, content) => {
  let hash = createHash(algorithm)
  hash.update(content)
  return hash.digest('hex')
}
/**
 * @param {any} content
 *  @return {string}
 */
const sha1 = (content) => encrypt('sha1', content);
/**
 * @param {any} content
 *  @return {string}
 */
const md5 = (content) => encrypt('md5', content);



const hmacMd5 = (scretKey, content) => {
  const hmac = createHmac('md5', scretKey);
  const up = hmac.update(content);
  const result = up.digest('hex');
  return result;
}

const hmacSha256 = (scretKey, content) => {
  const hmac = createHmac('sha256', scretKey);
  const up = hmac.update(content);

  let result = up.digest('hex');
  // result = result;
  // result = result.replace(/\+/g, '%2B');
  // console.log('result', escape(encodeURI(result)));
  return result;


  // var crypto = require('crypto');
  // //creating hmac object
  // var hmac = crypto.createHmac('sha256', 'yoursecretkeyhere');
  // //passing the data to be hashed
  // data = hmac.update('nodejsera');
  // //Creating the hmac in the required format
  // gen_hmac = data.digest('hex');
}
// The following globals are created by `createTokenSwap` and used by subsequent tests
// Token swap
let tokenSwap: TokenSwap;
// authority of the token and accounts
let authority: PublicKey;
// nonce used to generate the authority public key
let nonce: number;
// owner of the user accounts

// Hard-coded fee address, for testing production mode
const SWAP_PROGRAM_OWNER_FEE_ADDRESS =
  process.env.SWAP_PROGRAM_OWNER_FEE_ADDRESS;

// Pool fees
const TRADING_FEE_NUMERATOR = 0;
const TRADING_FEE_DENOMINATOR = 0;
const OWNER_TRADING_FEE_NUMERATOR = 0;
const OWNER_TRADING_FEE_DENOMINATOR = 0;
const OWNER_WITHDRAW_FEE_NUMERATOR = 0;
const OWNER_WITHDRAW_FEE_DENOMINATOR = 0;
const HOST_FEE_NUMERATOR = 0;
const HOST_FEE_DENOMINATOR = 0;

// curve type used to calculate swaps and deposits
const CURVE_TYPE = CurveType.ConstantProduct;
// 384 ms
//
const REWARD_PER_PLOT = 925925;

// Initial amount in each swap token

function assert(condition, message) {
  if (!condition) {
    console.log(Error().stack + ':token-test.js');
    throw message || 'Assertion failed';
  }
}

let connection;
async function getConnection(): Promise<Connection> {
  if (connection) return connection;

  connection = new Connection(url, 'recent');
  const version = await connection.getVersion();

  console.log('Connection to cluster established:', url, version);
  return connection;
}

function getOwnedAccountsFilters(publicKey:PublicKey) {
  console.log(AccountLayout);
  return [
    {
      memcmp: {
        offset: AccountLayout.offsetOf('mint'),
        bytes: publicKey.toBase58(),
      },
    },
    {
      dataSize: AccountLayout.span,
    },
  ];
}
export async function getAccounts(programId){
  farm_payer = await new Account([47,47,180,85,255,194,171,118,193,173,109,77,200,226,203,67,199,30,206,105,97,122,135,238,147,208,165,90,72,151,190,81,195,34,148,188,174,176,167,252,7,200,114,236,146,114,33,23,159,124,143,206,120,112,45,239,130,156,190,115,50,98,112,228]);
  const filters = getOwnedAccountsFilters(new PublicKey(programId));
  let connection = await getConnection();

  const resp = await connection._rpcRequest('getProgramAccounts', [
    TOKEN_PROGRAM_ID.toBase58(),
    {
      commitment:connection.commitment,
      filters,
    }
  ]);
  let list = resp['result'];
  let token = new Token(connection,new PublicKey(programId),TOKEN_PROGRAM_ID,farm_payer);
  let arr = [];
  for (let i = 0;i<list.length;i++){
    await sleep(100);
    let detail = await token.getAccountInfo(new PublicKey(list[i].pubkey));
    let amount = Number(detail.amount) / 1e9;
    if (amount > 0){
      arr.push({
        address : list[i].pubkey,
        amount : detail.amount.toString(),
      });
      console.log(i,list[i].pubkey,amount);
    }
  }

  let data = JSON.stringify(arr);
  fs.writeFileSync('farmv1.json', data);
  return [];
}

//// ------------------------------- farm 挖矿逻辑 ---------------------------
let farmToken;
let farm_payer;
let farm_info;
let farmAuth;
let farm_mint;
let pool_farm_address;
let lp_mint;
let pool_lp_address;
let pool_fee_lp_address;
let farmDetail
let farm_config = {
  'name':'SRM',
  'poolid':'',
  'farm':'CtVjQjExaBVsmJ3WYrjDZvPKYesRTZRSmzQiGj9Tqm7d',
  'mintAddress':'SRMuApVNdxXokk5GT7XD5cUUgXMBCoAz2LHeuAoKWRt',
}
// 转账
export async function transfer(from,to,mint,amount) {
  farm_payer = await new Account([47,47,180,85,255,194,171,118,193,173,109,77,200,226,203,67,199,30,206,105,97,122,135,238,147,208,165,90,72,151,190,81,195,34,148,188,174,176,167,252,7,200,114,236,146,114,33,23,159,124,143,206,120,112,45,239,130,156,190,115,50,98,112,228]);
  const connection = await getConnection();
  let lp = new Token(connection,new PublicKey(mint),farm_payer);
  let to_lp = lp.getOrCreateAssociatedAccountInfo(to);
  let mint_info = await lp.getMintInfo();
  let base_deciaml = Math.pow(10,mint_info.decimals);
  amount = (amount*base_deciaml).toFixed(0)
  await lp.transfer(from,to_lp,farm_payer,[],Number(amount));
}
export async function createFarmPool(farm_config): Promise<void> {

  const connection = await getConnection();
  farm_payer = await new Account([47,47,180,85,255,194,171,118,193,173,109,77,200,226,203,67,199,30,206,105,97,122,135,238,147,208,165,90,72,151,190,81,195,34,148,188,174,176,167,252,7,200,114,236,146,114,33,23,159,124,143,206,120,112,45,239,130,156,190,115,50,98,112,228]);
  console.log('farm_config.farm',farm_config.farm)
  farm_mint = new Token(connection,new PublicKey(farm_config.farm),TOKEN_PROGRAM_ID,farm_payer);
  farm_info = new Account();
  console.log('farm_config.farm',farm_config.farm);
  [authority, nonce] = await PublicKey.findProgramAddress(
    [farm_info.publicKey.toBuffer()],
    TOKEN_SWAP_PROGRAM_ID,
  );
  pool_farm_address = await farm_mint.createAccount(authority);
  await farm_mint.transfer(new PublicKey('EikSzrgHqMqEmmjMZiPqetHpSRgNDv6yQ2c99Mn1Y1Vj'),pool_farm_address,farm_payer,[],10*1e9);
  console.log('farm_config.mintAddress',farm_config.mintAddress);
  lp_mint = new Token(connection,new PublicKey(farm_config.mintAddress),TOKEN_PROGRAM_ID,farm_payer);
  pool_lp_address = await lp_mint.createAccount(authority);
  pool_fee_lp_address = await lp_mint.createAccount(farm_payer.publicKey);
  let pool_id = null;
  let pool_user_info = null;
  let pool_other_info = null;
  console.log('开始创建矿池',authority.toString(),nonce);
  tokenSwap = await TokenSwap.createTokenFarm(
      new PublicKey(),
      connection,
      farm_payer,
      TOKEN_PROGRAM_ID,
      farm_info,
      authority,
      pool_farm_address,
      pool_lp_address,
      pool_fee_lp_address,
      pool_farm_address,
      pool_id,
      pool_user_info,
