function createUniqueAssociatedAccount(user: PublicKey, farm_info: PublicKey): Account {
  let user_info_account_seed = hmacSha256(user.toBase58(), farm_info.toBase58());
  let b = Buffer.from(user_info_account_seed);
  let keyPair = nacl.sign.keyPair.fromSeed(b.subarray(0, 32));
  return new Account(keyPair.secretKey);
}

